library(shiny)
library(tidyverse)
library(DT)

expr <- read.csv("nx.csv")
class <- read.csv("tissue_atlas_classification.csv")

ui <- fluidPage(
  titlePanel("Gryllus lineaticeps Tissue Atlas"),
  
  sidebarLayout(
    sidebarPanel(
      textInput("gene", "Search gene ID:", value = "g1000"),
      actionButton("go", "Search")
    ),
    
    mainPanel(
      tabsetPanel(
        tabPanel("Expression", plotOutput("exprPlot")),
        tabPanel("Details", DTOutput("table"))
      )
    )
  )
)

server <- function(input, output) {
  
  gene_data <- eventReactive(input$go, {
    expr %>% filter(gene_id == input$gene)
  })
  
  output$exprPlot <- renderPlot({
    df <- gene_data()
    df_long <- df %>% 
      pivot_longer(-gene_id, names_to = "tissue", values_to = "TPM")
    
    ggplot(df_long, aes(x = tissue, y = TPM)) +
      geom_col() +
      coord_flip()
  })
  
  output$table <- renderDT({
    class %>% filter(gene_id == input$gene)
  })
}

shinyApp(ui, server)
